import React, { useEffect, useState } from "react";
import "./App.css";
import axios from "axios";
import { INews, IArticles } from "./types/news";
import Navbar from "./components/Navbar";
import Cards from "./components/Cards";
import { Col, Container, Row } from "reactstrap";

function App() {
  const [news, setNews] = useState<INews>();
  useEffect(() => {
    const fetchData = async () => {
      const data = await axios.get("https://newsapi.org/v2/top-headlines?country=id&apiKey=6ea25a8dca434dd38d9adfef34ecfa02");
      setNews(data.data);
    };
    fetchData();
  }, []);
  console.log(news);
  return (
    <>
      <Navbar />
      <Container fluid="md">
        <Row>
          {news &&
            news.articles.map((article: IArticles) => (
              <Col md="4" className="mt-5" key={article.title}>
                <Cards {...article} />
              </Col>
            ))}
        </Row>
      </Container>
    </>
  );
}

export default App;
